import './App.css';
import {useState, useEffect} from "react";

function App() {

    const [people, setPeople] = useState([]);

    function getPeople() {
        fetch('/fetchData')
            .then(response => response.json())
            // .then(data => console.log(data))
            .then(data => {
                console.log(data)
                setPeople(data)
            })
            .catch(error => console.error(error))
    }

    useEffect(() => {
        getPeople();
    }, []);

    return (
    <div className="App">
        <p>Input Postman Collection ID</p>
        <div>
          <input/>
          <button>Test</button>
        </div>
        <div>
            <p className="customer-title">Customers</p>
            <p className="previous-results">Previous Validation Results</p>
        </div>
        <div className='result-list'>

            {people.map((item, index) => (
                <ul>
                    <li key={index + "name"}>Name: {item.name}</li>
                    <li key={index + "gender"}>Gender: {item.gender}</li>
                    <li key={index + 'age'}>Age: {item.age}</li>
                    <li key={index + 'email'}>Email: {item.email}</li>
                </ul>
            ))}
        </div>
    </div>
  );
}

export default App;
